import React from 'react';

export default function TrainingUserTableList(props) {

  const { users, changeStatus } = props;
  if (users.length > 0) {
    const userRow = users.map((user, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{user.name}</td>
        <td>{user.position}</td>
        <td>
          <div
            onClick={() => changeStatus(user, false)}
            className="custom-control custom-switch">
            <input
              checked={user.status == "1" ? true : false}
              type="checkbox"
              className="custom-control-input cursor-pointer"
              name="example" />
            <label className="custom-control-label"
              htmlFor="switch001"></label>
          </div>
        </td>
        <td>
          <button className="btn btn-action">
            <img src="/dms/images/edit.svg" alt="" />
          </button>
        </td>
        <td>
          <button
            onClick={() => changeStatus(user, true)}

            className="btn btn-action">
            <img src="/dms/images/delete.svg" alt="" />
          </button>
        </td>
      </tr>
    ));
    return userRow;
  }
  return (
    <tr>
      <td colSpan="6" className="text-center">No Data</td>
    </tr>
  )
}
